import React from 'react';
import customButton from './customButton.css';

const LargeButton = ({ label, colour, desc, onClick }) => {
    const buttonColour = (() => {
        switch (colour) {
            case 'yellow':
                return 'custom-button yellow';
            case 'blue':
                return 'custom-button blue';
            case 'grey':
            default:
                return 'custom-button grey';
        }
    })();

    return (
        <button className={`${buttonColour} w-1/2`} onClick={onClick}>
            <div className='flex flex-col items-start gap-y-10'>
                <div className='text-3xl font-bold'>
                    {label}
                    <Link key={index} to={'/projects'}></Link>
                </div>

                <div className='text-xl font-bold'>
                    {desc}
                </div>

            </div>
        </button>
    );
};

export default LargeButton;
